import React from 'react'
import VisibilityIcon from '@mui/icons-material/Visibility';

const MyjobsComponents = ({jobs}) => {

  return (
    <div>
      {jobs ? jobs?.map(job => {
        return <div  >
            <h1>{job?.title}</h1>
            <p>status: {job?.status}</p>

            <button><VisibilityIcon /></button>

        </div>
      } ) : ''}
    </div>
  )
}

export default MyjobsComponents
